import React, { useState, useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import Footer from './footer';

const HomePage = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const systemLogRef = useRef(null);
  const [typedText, setTypedText] = useState('');
  const [cursor, setCursor] = useState('|');
  const [lineIndex, setLineIndex] = useState(0);
  const systemLogText = [
    'System Log',
    'Title: Full Stack Developer',
    'Skills: JavaScript, React, Node.js, Python, Data Analysis, Pandas, Web Scraping',
    'Experience: 5+ years',
    'Booting...',
    'Welcome back, User.',
    'All systems operational.',
    'System update complete.',
  ];

  const typeWriterEffect = () => {
    if (lineIndex < systemLogText.length) {
      const line = systemLogText[lineIndex];
      let charIndex = 0;

      const typeLine = () => {
        if (charIndex < line.length) {
          setTypedText((prevText) => prevText + line.charAt(charIndex));
          charIndex++;
          setTimeout(typeLine, 100);
        } else {
          setTimeout(() => {
            setTypedText((prevText) => prevText + '\n');
            setLineIndex((prevIndex) => prevIndex + 1);
          }, 500);
        }
      };

      typeLine();
    }
  };

  useEffect(() => {
    const handleResize = () => {
      setIsMobileView(window.innerWidth <= 1050);
    };
    handleResize();
    typeWriterEffect();

    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, [lineIndex]);

  useEffect(() => {
    const cursorInterval = setInterval(() => {
      setCursor((prevCursor) => (prevCursor === '|' ? ' ' : '|'));
    }, 500);

    return () => clearInterval(cursorInterval);
  }, []);

  const commonStyle = {
    color: '#00FF00',
    backgroundColor: '#1A1A1A',
    minHeight: '100vh',
    fontFamily: "'Courier New', Courier, monospace",
    textAlign: 'center',
    padding: '0 20px',
    boxSizing: 'border-box',
  };

  const pipBoyFrameStyle = {
    border: '5px solid #00FF00',
    padding: '20px',
    borderRadius: '10px',
    boxShadow: '0 0 10px 0 rgba(0, 255, 0, 0.5)',
    margin: '0 auto',
    maxWidth: '80%',
    position: 'relative',
    minHeight: '100vh',
  };

  const systemLogStyle = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: '80%',
    color: '#00FF00',
    fontFamily: "'Courier New', Courier, monospace",
    padding: '20px',
    backgroundColor: '#171717',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 255, 0, 0.5)',
    whiteSpace: 'pre-wrap',
    fontSize: '18px',
    lineHeight: '1.6',
  };

  const buttonStyle = {
    padding: '10px 20px',
    border: '2px solid #00FF00',
    color: '#00FF00',
    textDecoration: 'none',
    borderRadius: '5px',
    fontSize: '18px',
    transition: 'background-color 0.3s, color 0.3s',
  };

  const interestsStyle = {
    backgroundColor: '#2D2D2D',
    color: '#00FF00',
    padding: '20px',
    width: '250px',
    height: 'auto',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 255, 0, 0.5)',
    marginTop: '20px',
    border: '2px solid #00FF00',
    textAlign: 'left',
    paddingLeft: '15px',
  };

  return (
    <div style={commonStyle}>
      <div style={pipBoyFrameStyle}>
        <header style={{ textAlign: 'center', marginBottom: '30px' }}>
          <h1 style={{ fontSize: isMobileView ? '25px' : '40px', fontWeight: 'bold' }}>
            Hi, I'm Mohammed ðŸ‘‹
          </h1>
          <p style={{ fontSize: isMobileView ? '18px' : '24px' }}>
            I have been coding and analyzing data for 5+ years ðŸ¤–
          </p>
        </header>

        <div ref={systemLogRef} style={systemLogStyle}>
          System Log
          <br />
          {typedText}
          <span>{cursor}</span>
        </div>

        <div style={{ margin: '2rem', display: 'flex', justifyContent: 'center', gap: '1rem' }}>
          <Link
            to="/about"
            style={buttonStyle}
            onMouseEnter={(e) => {
              e.target.style.backgroundColor = '#003300';
              e.target.style.color = '#00FF00';
            }}
            onMouseLeave={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#00FF00';
            }}
          >
            About Me
          </Link>
          <a
            href="https://react--portfolio.s3.eu-west-2.amazonaws.com/Mohammed+Bakhshi+CV+.pdf"
            download="Mohammed_Bakhshi_CV.pdf"
            target="_blank"
            rel="noopener noreferrer"
            style={buttonStyle}
            onMouseEnter={(e) => {
              e.target.style.backgroundColor = '#003300';
              e.target.style.color = '#00FF00';
            }}
            onMouseLeave={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#00FF00';
            }}
          >
            View CV
          </a>
        </div>

        <div style={interestsStyle}>
          <h3>Interests</h3>
          <ul>
            <li>Web Development</li>
            <li>Data Science</li>
            <li>Machine Learning</li>
            <li>Gaming</li>
            <li>Reading</li>
          </ul>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default HomePage;
